    aN = float(aN)
    aR = float(aR)
    aV = float(aV)
    aZ = float(aZ)
    aP = float(aP)
    aT = float(aT)
    aX = float(aX)
    bb = float(bb)
    aO = float(aO)
    aS = float(aS)
    aW = float(aW)
    ba = float(ba)
    aQ = float(aQ)
    aU = float(aU)
    aY = float(aY)
    bc = float(bc)
    I = fD(aN, aO, aP, aQ, aR, aS, aT, aU, aV, aW, aX, aY, aZ, ba, bb, bc)
    for c in range(0, 9):
        I[c] = I[c] / I[8]

    fE = [
        I[0], I[1], 0, I[2], I[3], I[4], 0, I[5], 0, 0, 1, 0, I[6], I[7], 0, I[8]]
    return fE


